description:
Verenigde Staten
Drama
76 minuten

geregisseerd door Will Canon
met Trevor Morgan, Jon Foster en Lou Taylor Pucci

Adam Buckley moet als opdracht voor zijn ontgroening voor een studentenvereniging in zijn laatste nacht een supermarkt overvallen. Wanneer de rituele inwijding echter vreselijk mis gaat blijkt iedere beweging rampzalig te zijn. Adam wordt gedwongen een standpunt in te nemen om een vriend te redden en te beslissen waar zijn loyaliteit ligt.

